"use strict";

import SvgIcon from "../../SvgIcon";
import { critical } from "../../svgDefinitions";

/**
 * The Critical icon class constructor
 * @class Critical
 * @extends SvgIcon
 */
export default class Critical extends SvgIcon {
    /**
     * @inheritDoc
     */
    get _name() {
        return "Critical";
    }

    /**
     * @inheritDoc
     */
    initialProps() {
        const props = super.initialProps();
        return Object.assign(props, {
            defaultClassNames: `${props.defaultClassNames} mpageui-SvgIcon-clinical-critical`
        });
    }

    /**
     * @inheritDoc
     */
    getSvg() {
        return critical;
    }
}
